Azure Function returning empty data set from Cosmos Db Mongo Collection<p>I have an Azure function that is querying a cosmos db mongo collection that is certainly holding data. </p>

<p><a href="https://i.stack.imgur.com/aOVba.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/aOVba.png" alt="Data is in the collection"></a></p>

<p>However, when querying through my azure function, the function is returning an empty array. </p>

<p>My function looks something like: </p>

<pre><code>    [FunctionName("GetAll")]
    public static IActionResult Run([HttpTrigger(AuthorizationLevel.Function, "get", Route = null)]HttpRequest req, 
        TraceWriter log, [Inject(typeof(IWarehouseStateRepository))]IWarehouseStateRepository repoW)
    {
        log.Info("GetAll Function is processing a request");
        var warehouses = repoW.GetAllWarehouses();
        return warehouses != null ? 
            (ActionResult)new OkObjectResult(warehouses) :
            new BadRequestObjectResult("Something went wrong with this request");
    }
</code></pre>

<p>I am injecting a custom type for my warehouse repository which depends on a db configuration context which looks something like this:</p>

<pre><code>public class StateContext : IStateContext
{
    private readonly IMongoDatabase _database = null;
    private readonly string _connectionString;
    private readonly string _dbName;
    private readonly string _collectionName;

    public StateContext()
    {

        _connectionString = Environment.GetEnvironmentVariable("AggregateDbConnectionDev");
        _dbName = Environment.GetEnvironmentVariable("AggregateDbNameDev");
        _collectionName = Environment.GetEnvironmentVariable("AggregateDbCollectionDev");

        MongoClientSettings settings = MongoClientSettings.FromUrl(new MongoUrl(_connectionString));
        settings.SslSettings = new SslSettings() { EnabledSslProtocols = SslProtocols.Tls12 };

        var client = new MongoClient(settings);
        if (client != null)
            _database = client.GetDatabase(_dbName);
    }

    public IMongoCollection&lt;WarehouseState&gt; WarehouseState
    {
        get
        {
            return _database.GetCollection&lt;WarehouseState&gt;(_collectionName);
        }
    }
}
</code></pre>

<p>The function throws no errors or exceptions. </p>

<p>And the repo query:</p>

<pre><code>    public IEnumerable&lt;WarehouseState&gt; GetAllWarehouses()
    {
        var warehouses = _context.WarehouseState.Find(_ =&gt; true).ToList();
        return warehouses;
    }
</code></pre>

<p>Does anyone have any ideas what could be going wrong here? Do I need to set up cosmos Db connection in a different way with azure function?</p>

<p>This setup has worked previously before moving the logic over to an azure function. </p>

