Most efficient structure of mongoose Schema<p>I'm curious what the best way to structure my mongoose Schema is. I'm making a movie site with the User schema set like this: </p>

<pre><code>let UserSchema = new mongoose.Schema({
    username: {
        type: String,
        index: true
    },
    password: {
        type: String
    },
    email: {
        type: String
    },
    name: {
        type: String
    },
    watchlist: [mongoose.Schema.Types.Mixed],
    seen: {
        like : {
            type: [mongoose.Schema.Types.Mixed]
        },
        dislike: {
            type: [mongoose.Schema.Types.Mixed]
        }
    },
});
</code></pre>

<p>When a user clicks either a thumbs up or thumbs down icon, an object of</p>

<p><code>{movieID: movieID, title: movieTitle, poster: moviePoster}</code> </p>

<p>will be sent to the like or dislike array in the seen property. I'm going to use this info in my EJS template to determine if a movie has already been seen and if seen and liked then gray out the dislike button and if seen and disliked gray out the like button. I also want to be able to remove the item from seen if the use clicks a 'clear' button. In order to do that it seems like I'm going to have to loop over both arrays in order to determine if the movie is included in one and then remove it. Seems like there has to be a better way to do it. I was thinking of structuring the 'seen' object using the movieID as a key, like this: </p>

<pre><code>seen: {
  '123': {
    movieID: '123',
    title: 'movieA',
    poster: 'movieA-poster.jpg',
    like: true
  }, 
  '456' : {
    movieID: '456',
    title: 'movieB',
    poster: 'movieB-poster.jpg',
    like: false
  }
}
</code></pre>

<p>But when I try to send the data to seen using .findOne and this function: </p>

<pre><code>const movieObj = {
  id: req.body.movieID,
  title: req.body.movieTitle,
  poster_path: req.body.poster_path,
};

User.findOne({_id: req.user._id}, function(err, user) {
  if (err) {
    console.log(err);
  } else {

    user.seen[req.body.movieID] = movieObj;
    user.save(function(){});
  }
}
</code></pre>

<p>I still just get an empty object returned to me. I changed the schema seen object to: </p>

<pre><code>seen: { type: mongoose.Schema.Types.Mixed, default: {} }
</code></pre>

<p>and have set {minimize: false}, because I read that mongoose by default doesn't allow empty objects. Appreciate any guidance on what I'm doing wrong or if you have a better way to efficiently structure the schema to allow seen movies to easily be added or removed from the db. </p>

